const PostPhotos = ({ photos, username }) => {
  username = `Esta publicación fue creada por ${username}`;
  return (
    <ul>
      {photos.map((photo) => {
        return (
          <li key={photo.id}>
            <img src={`http://localhost:4000/${photo.name}`} alt={username} />
          </li>
        );
      })}
    </ul>
  );
};

export default PostPhotos;
